package com.wckj.chasstage.api.def.qtdj.model;import io.swagger.annotations.ApiParam;/** * describe: * * @author lcm * @date 2020/09/21 */public class UserParam {    @ApiParam("警号")    private String loginId;    @ApiParam("用户名")    private String name;    @ApiParam("单位代码")    private String orgCode;    @ApiParam("身份证号")    private String idCard;    @ApiParam("单位名称")    private String orgName;    @ApiParam("单位系统代码")    private String orgSysCode;    @ApiParam("性别")    private String sex;    public String getIdCard() {        return idCard;    }    public void setIdCard(String idCard) {        this.idCard = idCard;    }    public String getLoginId() {        return loginId;    }    public void setLoginId(String loginId) {        this.loginId = loginId;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getOrgCode() {        return orgCode;    }    public void setOrgCode(String orgCode) {        this.orgCode = orgCode;    }    public String getOrgName() {        return orgName;    }    public void setOrgName(String orgName) {        this.orgName = orgName;    }    public String getOrgSysCode() {        return orgSysCode;    }    public void setOrgSysCode(String orgSysCode) {        this.orgSysCode = orgSysCode;    }    public String getSex() {        return sex;    }    public void setSex(String sex) {        this.sex = sex;    }}